import React, { useState } from "react";

export default function UserProfile({ userEmail, userData, setUserData }) {
  const [newCharacter, setNewCharacter] = useState("");
  const [newLabel, setNewLabel] = useState("");

  // Agrega un personaje sin perder otras propiedades
  const addCharacter = () => {
    if (!newCharacter.trim() || !newLabel.trim()) return;

    setUserData((prev) => ({
      ...prev,
      characters: [...(prev.characters || []), { name: newCharacter.trim(), label: newLabel.trim() }],
      // Añade la etiqueta si no existe aún
      labels: prev.labels?.includes(newLabel.trim()) ? prev.labels : [...(prev.labels || []), newLabel.trim()],
    }));

    setNewCharacter("");
    setNewLabel("");
  };

  // Elimina personaje por índice, manteniendo resto de datos
  const removeCharacter = (index) => {
    setUserData((prev) => ({
      ...prev,
      characters: prev.characters.filter((_, i) => i !== index),
    }));
  };

  // Agrega una etiqueta sin borrar otras propiedades
  const addLabel = () => {
    if (!newLabel.trim() || userData.labels?.includes(newLabel.trim())) return;

    setUserData((prev) => ({
      ...prev,
      labels: [...(prev.labels || []), newLabel.trim()],
    }));

    setNewLabel("");
  };

  // Elimina etiqueta y personajes asociados a ella
  const removeLabel = (index) => {
    const labelToRemove = userData.labels[index];

    setUserData((prev) => ({
      ...prev,
      labels: prev.labels.filter((_, i) => i !== index),
      characters: prev.characters.filter((char) => char.label !== labelToRemove),
    }));
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>Perfil de {userEmail}</h2>

      <section>
        <h3>Personajes con etiquetas</h3>
        {(!userData.characters || userData.characters.length === 0) && <p>No tienes personajes aún.</p>}
        {(userData.characters || []).length > 0 && (
          <ul>
            {userData.characters.map(({ name, label }, i) => (
              <li key={i}>
                {name} - <em>{label}</em>{" "}
                <button onClick={() => removeCharacter(i)} aria-label="Eliminar personaje">×</button>
              </li>
            ))}
          </ul>
        )}
        <input
          type="text"
          placeholder="Nombre del personaje"
          value={newCharacter}
          onChange={(e) => setNewCharacter(e.target.value)}
        />
        <select value={newLabel} onChange={(e) => setNewLabel(e.target.value)}>
          <option value="">Selecciona etiqueta</option>
          {(userData.labels || []).map((label, i) => (
            <option key={i} value={label}>
              {label}
            </option>
          ))}
        </select>
        <button onClick={addCharacter}>Agregar personaje</button>
      </section>

      <section style={{ marginTop: 30 }}>
        <h3>Etiquetas (Labels)</h3>
        {(!userData.labels || userData.labels.length === 0) && <p>No tienes etiquetas aún.</p>}
        {(userData.labels || []).length > 0 && (
          <ul>
            {userData.labels.map((label, i) => (
              <li key={i}>
                {label}{" "}
                <button onClick={() => removeLabel(i)} aria-label="Eliminar etiqueta">
                  ×
                </button>
              </li>
            ))}
          </ul>
        )}
        <input
          type="text"
          placeholder="Nueva etiqueta"
          value={newLabel}
          onChange={(e) => setNewLabel(e.target.value)}
          onKeyDown={(e) => e.key === "Enter" && addLabel()}
        />
        <button onClick={addLabel}>Agregar etiqueta</button>
      </section>
    </div>
  );
}
